export default class Main extends Component {
  constructor(){
    
  }

  render() {
    return (
      <div>
      <ul>
        <li>React</li>
        <li>Angular</li>
        <li>Vue</li>
      </ul>
      <button className='btn btn-primary'>click me</button>
      </div>
    )
  }
}
